import { useState,useEffect } from "react";
const FetchDataa = () => {

  const [initData, setInitData] = useState([{}]);

  console.log(1)


  const fetchMyAPI = () => {
    fetch('http://127.0.0.1:5000').then((response) => response.json()).then((data) => setInitData(data))
    };


  useEffect(() => {
    fetchMyAPI();
  }, []);

  return (
    <div>
      {initData}
    </div>
  )
};

export default FetchDataa;
